import Link from 'next/link';

export default function({post}) {
 return (
    <li key={post.slug}>
        <span class="postdate">{post.date}</span> - 
        <Link href={{ pathname: `/blog/${post.slug}` }}>
            <a>{post.frontmatter.title}</a> 
        </Link> - 
        <span class="postsummary">{post.summary}</span>
    </li>
 )
}
